text:
Всем привет! Ищу *Data Engineer* к себе в команду в YouDo.

Команда занимается следующими продуктовыми задачами:
- Рекомендательными системами;
- Интеллектуальной системой антифрода;
- Персонализированной системой маркетинга;
- Моделями ценообразования;
- Прочими задачами, связанными с машинным обучением и анализом данных.

Чем предстоит заниматься:
- Строить платформу real time/batch обработки и аналитики данных;
- Разрабатывать различные production решения, связанные с анализом данных и машинным обучением;
- Разбираться с модными базвордмами из мира распределенных систем.

Что мы ждем от кандидата?
- Хорошие знания Python и SQL;
- Знания в области алгоритмов;
- Опыт работы с реляционными, нереляционными, колоночными и прочими базами данных. Умение разобраться в их слабых и сильных сторонах.
- Опыт работы со Spark.

Будет плюсом, если у вас есть:
- Знания в области DevOps, CI/CD и контейнеризация;
- Так же будет круто, если хотите получать знания в области DS/ML и пускать свои ручонки эту область.

Условия:
- ЗП 150-220 на руки;
- Офис в Москве в 5 минутах пешком от метро “Улица 1905 года“.
